chrome.tabs.getSelected(null,function(tab){chrome.tabs.sendRequest(tab.id,{action:"getBdysls"},function(response){if(response.result){$(".bdyslocl-bd").empty().append(response.result)}})});$(".bdyslocl-bd").delegate("a","click",function(){var sPswd=$(this).attr("data-pswd");localStorage.setItem("autoLoginPswd",sPswd)});document.addEventListener("DOMContentLoaded",function(){$("#name").text(chrome.runtime.getManifest().name);$("#version").text(chrome.runtime.getManifest().version)});